    "narrative-report-pathfinder-national-wildlife-refuge-january-through-december-1970",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Pathfinder
    National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
    year. The report begins by summarizing the weather conditions, habitat conditions,
    water conditions, and food and cover conditions during the year. Wildlife- including
    migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
    raptors, fish, and reptiles- is also covered. The Refuge development and maintenance
    section discusses physical developments. Resource management is outlined; topics
    include grazing. The public relations section of the report describes recreational
    uses, Refuge participation, and hunting. Items of interest, N-R forms, and photographs
    are attached.",nt"license_title": "License Not Specified",nt"extras":
